// Logout.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Logout = () => {
    const navigate = useNavigate();  // Ensure you have 'react-router-dom' installed and set up

    const handleLogout = async () => {
        const refreshToken = localStorage.getItem('refreshToken');
        try {
            const response = await fetch('/api/user/logout/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': `Bearer ${localStorage.getItem('token')}`
                },
                body: JSON.stringify({
                    refresh_token: refreshToken
                })
            });

            if (response.ok) {
                console.log("Successfully logged out");
                navigate('/home');
            } else {
                const data = await response.json();
                console.error("Error:", data.error);
            }
        } catch (error) {
            console.error("Logout failed:", error);
        }
    };

    return (
        <button onClick={handleLogout}>Logout</button> // Render a button to trigger logout
    );
};

export default Logout; // Ensure you're exporting it correctly
